package main

import (
	//"regexp"
	"fmt"
	//	"strconv"
	//	"strings"
)

func main() {
	input := ""
	aimFor := 14
	for i := aimFor - 1; i < len(input); i++ {
		seen := map[byte]struct{}{}
		for j := i - aimFor + 1; j <= i; j++ {
			seen[input[j]] = struct{}{}
		}
		if len(seen) == aimFor {
			fmt.Println("Got it, after", i+1)
			break
		}
	}
}
